    - ID: "c3afee16-1dbc-4a49-8037-9d03d0d7d62e"
      Hint: description
      Value: |
        <p><strong>Dual Air Compressor </strong></p>
        <p>Our air compressor skids are fitted complete with a Tier 3 diesel engine (with radiator, fan, air cleaner, electric start, and emergency kill system), compressor air inlet filters, moisture separator, automatic drain, two 9.5-ft<sup>3</sup> air receiver tanks, an air-to-air aftercooler with a 12-volt fan, and belt guards. The compressed air outlet is fitted with one 3-in. kamlock and check valve. All equipment is mounted on an I-beam skid base with a four-point lift frame.</p>
        <p>Each compressor is complete with shotblast and four-coat paint system.</p>
